import './App.css';
import logo from "./img/logo.png"

function App() {
  return (
    <div className='App'>
      <header className='appHeader'>
      <div className='logo'>
        <img src={logo} alt="logo"></img>
        <p><strong>Ts217Books</strong></p>
      </div>
      </header>
    </div>
  );
}

export default App;
